                'Thermal inners - 1 Pair',
                '1 pair of gloves',
                'Sun cap',
                'One scarf',
                'Light towel',
                'Lip balm',
                'Cold cream and sunscreen (SPF 40+)',
                'Water bottle 1 lt (At least)',
                'Headlamp or torch with fresh pair of batteries',
                'Personal toiletries and toilet paper',
                'Personal medicine kit',
